import "../styles/Navbar.css";
import CircleIcon from "./CircleIcon";

type NavbarProps = {
  onClickPulse: () => void;
  title: string;
};

function Navbar({ onClickPulse, title }: NavbarProps) {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        {title === "Progress" && (
          <CircleIcon icon={<i className="ri-sparkling-fill" />} />
        )}
      </div>
      <h3 className="navbar-title">{title}</h3>
      <div className="navbar-right" onClick={onClickPulse}>
        {title === "Daily" && (
          <CircleIcon icon={<i className="ri-pulse-fill"></i>} />
        )}
      </div>
    </nav>
  );
}

export default Navbar;
